pub enum HandleMsg {

    /// AddLiquidity will deposit LUNA and Token to add liquidity between them
    AddLiquidity {
        luna_amount: Uint128,
        token_amount: Uint128,
        token_address: HumanAddr,
        token_id: Uint128,
    },
    SwapTokenToLuna {
        amount: Uint128,
        token_id: Uint128,
        recipient: HumanAddr,
    },
    SwapLunaToToken {
        amount: Uint128,
        token_id: Uint128,
        recipient: HumanAddr,
    },
    RemoveLiquidity {
        token_id: Uint128,
    },
}

pub enum ERC20HandleMsg {
    Approve {
        spender: HumanAddr,
        amount: Uint128,
    },
    Transfer {
        recipient: HumanAddr,
        amount: Uint128,
    },
    TransferFrom {
        owner: HumanAddr,
        recipient: HumanAddr,
        amount: Uint128,
    },
    Burn {
        amount: Uint128,
    },
}

pub enum QueryMsg {
    Pair {
        token_id: Uint128,
    },
    Reserve {
        token_id: Uint128,
    },
    Config {
    },
}
